# Deep Learning - Imageprocessing - Algorithm - Convolutional Neural Networks(CNN)   Study images in details.
# CNN was developed to improve accuracy of image processing models, complex images like medical scans,geo spatial images, etc.have lower predictive
# accuracy and CNN's were exclusively developed to work on such data data.
# CNN is a predefined neural network model whihc can be modified according to the model requirements.

# Variants of CNN are VGGNet, Alexnet, googleNet, etc.

# Basic CNN model will have Convolution Layers followed by Pooling Layers and finally Neural Network Layers for predicting.

"""![image.png](data:image/png;base64,)"""

# Convolutional Layer is the first layer which reduces the image dimensionality by applying a kernel filter like 2X2 or 3X3 filter that helps in
# reducing blurness, improve sharpness of images, size of image, etc without loosing any information.

"""![image.png](data:image/png;base64,)"""

# Padding in CNN is adding a layer of Zeros on the outer edge of image for efficient edge detection and to prevent information loss.

"""![image.png](data:image/png;base64,)"""

# After Convolution Layer is Pooling Layer. Pooling layer applies a 2X2 kernel filter on the Convolution layer output for reducing the image dimension.
# 2 types of pooling - MaxPooling and Average Pooling.

# Max pooling - Max value in Quadrant is taken.
# Avg pooling - Avg of all 4 values in the Quadrant.

"""![image.png](data:image/png;base64,)"""

# After Pooling layer, Flattern Layer is which the process of converting the matrix or a tensorinto a vector or single array. Flatten output will be
# the input for Neural Network.

"""![image.png](data:image/png;base64,)"""

# Finally after Flattening, Neural Network have to be defined using the Dense, Activation function and compile the relevant metrics for NN like
# optimizer, loss, metric.

import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns

import tensorflow

from keras.datasets import fashion_mnist

(X_train,y_train),(X_test,y_test) = fashion_mnist.load_data()

print(X_train.shape)
print(X_test.shape)

# Reshape the data

X_train = X_train.reshape(60000,28,28,1)
X_test  = X_test.reshape(10000,28,28,1)

# Convert from 64bit to 32bit.
X_train = X_train.astype('float32')
X_test = X_test.astype('float32')

# Normalize or MinMax Scale Data.
X_train = X_train/255
X_test = X_test/255

# LabelEncode Depedent Variable
y_train = tensorflow.keras.utils.to_categorical(y_train,10)
y_test = tensorflow.keras.utils.to_categorical(y_test,10)

from keras.models import Sequential
from keras.layers import Conv2D,MaxPool2D,BatchNormalization
from keras.layers import Dense,Flatten,Activation

cnn = Sequential()
cnn.add(Conv2D(32,(3,3),activation='relu',input_shape=(28,28,1),padding='same'))

cnn.add(BatchNormalization())
cnn.add(Conv2D(32,(3,3),activation='relu',padding='same'))
cnn.add(Conv2D(24,(3,3),activation='relu',padding='same'))
cnn.add(Conv2D(64,(3,3),activation='relu',padding='same'))
cnn.add(Conv2D(32,(3,3),activation='relu',padding='same'))
cnn.add(MaxPool2D(pool_size=(2,2)))
cnn.add(Flatten())
cnn.add(Dense(128,activation='relu'))
cnn.add(Dense(10,activation='softmax'))
cnn.compile(optimizer='adam',loss='categorical_crossentropy',metrics=['accuracy'])
cnn.summary()

cnnmodel = cnn.fit(X_train,y_train,epochs=20,batch_size=128,validation_data=(X_test,y_test))

plt.plot(cnnmodel.history['accuracy'],label='accuracy')
plt.plot(cnnmodel.history['val_accuracy'],label='val_accuracy')
plt.xlabel('Epoch')
plt.ylabel('accuracy')
plt.ylim([0.86,1])
plt.legend()
plt.show()

